/**
 * @file
 * Contains the functionality for refreshing blocks.
 */

(function ($, Drupal, drupalSettings) {

  var wrapper = drupalSettings.ajax_block.wrapper;
  var url = drupalSettings.ajax_block.url;

  Drupal.behaviors.ajaxBlock = {

    /**
     * Attach function.
     *
     * @param context
     *   The context.
     */
    attach: function (context) {
      if (context != document) {
        return;
      }

      var self = this;

      $(document).once('ajax_block').each(function () {
        self.attachListeners();
        self.attachWindowPopStateListener();

        window.history.replaceState(
          { data: {
              block_id: drupalSettings.ajax_block.blockId,
              url: window.location.pathname + window.location.search,
              block_configuration: drupalSettings.ajax_block.blockConfiguration,
            } },
          null,
          window.location.pathname + window.location.search
        );
      });
    },

    /**
     * Attach event listeners.
     */
    attachListeners: function () {
      this.$wrapper = $('#' + wrapper);
      this.$body = $("html");
      this.attachLinkListeners();
      this.attachSelectListeners();
      this.attachSubmitListeners();
    },

    /**
     * Attaches windows by pop state.
     */
    attachWindowPopStateListener: function () {
      var self = this;

      window.addEventListener('popstate', function (event) {
        if (event.state) {
          var data = event.state.data;
          self.refreshBlockByAjax(data);
        }
      });
    },

    /**
     * Attach the link listeners.
     */
    attachLinkListeners: function () {
      var self = this;
      this.$bodyWrapper = $("body");

      this.$wrapper.find('.ajax-link-wrapper').find('a').on('click', function (e) {
        e.preventDefault();
        var href = $(this).attr('href');
        if($(this).hasClass('js-pager-trigger')) {
          const pageHeader = $('.page-header');

          // The pager does not contain the current URL.
          // So we attach the window location URL here.
          href = window.location.pathname + href;

          if (pageHeader) {
            var offsetTop = pageHeader.height();
            if (self.$bodyWrapper.hasClass('toolbar-horizontal') || self.$bodyWrapper.hasClass('toolbar-vertical')) {
              offsetTop -= (self.$bodyWrapper.hasClass('toolbar-tray-open') ? 79 : 39);
            }
            $('html, body').animate({
              scrollTop: pageHeader.offset().top + offsetTop
            }, 150);
          }
        }
        self.refreshBlockByUrl(href);
        return false;
      });
    },

    /**
     * Attach Select listeners.
     */
    attachSelectListeners: function (){
      var self = this;
      this.$bodyWrapper = $("body");

      this.$wrapper.find('.js-ajax-select-list').on('change', function (e) {
        e.preventDefault();
        var href = $(this).val();
        self.refreshBlockByUrl(href);
        return false;
      });
    },

    /**
     * Attach Submit listeners.
     */
    attachSubmitListeners: function () {
      var self = this;
      var $form = this.$wrapper.find('form');

      $form.submit(function (e) {
        self.refreshBlockByFormSubmit();
        e.preventDefault();
        return false;
      });
    },

    /**
     * Refreshes a block by form submit.
     */
    refreshBlockByFormSubmit: function () {
      var data = {
        block_id: drupalSettings.ajax_block.blockId,
        form: this.$wrapper.find('form').serialize(),
        url: drupalSettings.path.baseUrl + drupalSettings.path.currentPath,
        block_configuration: drupalSettings.ajax_block.blockConfiguration,
      }

      this.refreshBlockAndUpdateState(data);
    },

    /**
     * Refreshes the block by link click.
     *
     * @param href
     *   The link that was clicked.
     */
    refreshBlockByUrl: function (href) {
      var data = {
        block_id: drupalSettings.ajax_block.blockId,
        url: href,
        block_configuration: drupalSettings.ajax_block.blockConfiguration,
      }

      this.refreshBlockAndUpdateState(data);
    },

    /**
     * Refresh the block and upate the state.
     */
    refreshBlockAndUpdateState: function(data) {
      var defer = $.Deferred();
      this.refreshBlockByAjax(data, defer);

      $.when(defer).done(function(data, responseData) {
        if (responseData.url) {
          history.pushState(null, null, responseData.url);
          // Update the state.
          window.history.replaceState(
            { data: data },
            null,
            responseData.url
          );
        }
      });
    },

    /**
     * Refreshes a block using ajax.
     *
     * @param data
     *   The data to send to the refresh block controller.
     */
    refreshBlockByAjax: function (data, defer) {
      var self = this;
      self.$body.addClass("block-refreshing");
      $.ajax({
        type: "POST",
        url: '/ajax/block/refresh',
        data: data,
        success: function (responseData) {
          if (responseData.html) {
            self.$wrapper.parent('.block').replaceWith(responseData.html);
          }

          self.attachListeners();
          $(document).trigger('blockRefreshEvent', responseData);
          self.$body.removeClass("block-refreshing");

          // re-call the attach functions.
          Drupal.attachBehaviors();

          if (defer) {
            defer.resolve(data, responseData);
          }
        }
      });
    },
  };
})(jQuery, Drupal, drupalSettings);
